federation.serviceSdl:
extend schema @link(url: "https://specs.apollo.dev/federation/v2.5", import: ["@key"])

type Contact @key(fields: "id") {
  id: ID!
  displayName: String @external
}

type PageInfo @shareable {
  endCursor: String
  hasNextPage: Boolean!
  startCursor: String
  hasPreviousPage: Boolean!
}

type ContactConnection {
  nodes: [Contact!]! @provides(fields: "displayName")
  edges: [ContactEdge!]!
  pageInfo: PageInfo!
  totalCount: Int!
  totalMatches: Int!
}

type ContactEdge {
  cursor: String!
  node: Contact! @provides(fields: "displayName")
}

type Query {
  contacts(
    last: Int
    before: String
    first: Int
    after: String
  ): ContactConnection! @provides(fields: "edges { node { displayName } }")
}

engineConfig.graphqlSchema:
schema {
  query: Query
}

directive @authenticated on ENUM | FIELD_DEFINITION | INTERFACE | OBJECT | SCALAR

directive @inaccessible on ARGUMENT_DEFINITION | ENUM | ENUM_VALUE | FIELD_DEFINITION | INPUT_FIELD_DEFINITION | INPUT_OBJECT | INTERFACE | OBJECT | SCALAR | UNION

directive @requiresScopes(scopes: [[openfed__Scope!]!]!) on ENUM | FIELD_DEFINITION | INTERFACE | OBJECT | SCALAR

directive @tag(name: String!) repeatable on ARGUMENT_DEFINITION | ENUM | ENUM_VALUE | FIELD_DEFINITION | INPUT_FIELD_DEFINITION | INPUT_OBJECT | INTERFACE | OBJECT | SCALAR | UNION

scalar openfed__Scope

type Contact {
  id: ID!
  firstName: String
  lastName: String
  displayName: String
  initials: String
  pictureUrl: String
  company: String
  role: String
}

type PageInfo {
  endCursor: String
  hasNextPage: Boolean!
  startCursor: String
  hasPreviousPage: Boolean!
}

type ContactConnection {
  nodes: [Contact!]!
  edges: [ContactEdge!]!
  pageInfo: PageInfo!
  totalCount: Int!
  totalMatches: Int!
}

type ContactEdge {
  cursor: String!
  node: Contact!
}

type Query {
  contacts(last: Int, before: String, first: Int, after: String): ContactConnection!
}
